import React from 'react'
import exerciseImg from '../images/exercise.png'
import CircleImg from '../images/circles.png'
import './Styles/Card.css'

    /* background: url('../../images/circles.png') no-repeat, linear-gradient(to right, #A74CF2, #617BFB); */

class Card extends React.Component{
    render(){
        return (
            <div className="card mx-auto Fitness-Card"style={{
                backgroundImage:`url(${CircleImg})`
            }}
            >
                <div className="card-body">
                    <div className="row center">
                        <div className="col-6">
                            <img src={exerciseImg} alt="Technique Guides"/>
                        </div>
                        <div className="col-6">
                            <h1>Technique Guides</h1>
                            <p>Learn amazing street workout and calisthenics skills</p>
                        </div>
                    </div>
                </div>
            </div>
            
        )
    }
}

export default Card
